import { useParams } from "react-router-dom";
import { getInvoice } from "../data";

export default function Invoice() {
  let params = useParams();
  let fake = params.id;
  let invoice = getInvoice(fake);
  return (
    <main style={{ padding: "1rem" }}>
      <p>Due Date: {invoice.location}</p>
    </main>
  );
}
